    }

      color: white;

    .info-bar {
      display: flex;
      justify-content: space-between;
      align-items: center;
      margin-bottom: 1rem;
      font-size: 0.95rem;
      opacity: 0.85;

    .grid-wrapper {
      max-height: 400px;
      overflow-y: auto;
      padding-right: 10px;
    }
    .grid {
      display: grid;
      grid-template-columns: repeat(auto-fill, minmax(200px, 1fr));
      gap: 1rem;
    }
    .card {
      background: rgba(255, 255, 255, 0.05);
      border-radius: 1rem;
      padding: 1rem;
      backdrop-filter: blur(8px);
      transition: transform 0.2s;
      cursor: pointer;
    }
    .card:hover {
      transform: scale(1.05);
      background: rgba(255, 255, 255, 0.1);
    }
    .script-section {
      margin-top: 3rem;
    }
    #editor {
      height: 300px;
      width: 100%;
      border-radius: 1rem;
      overflow: hidden;
      margin-top: 1rem;
    }
    button.run-script {
      background: #1db954;
      padding: 0.5rem 1rem;
      border: none;
      border-radius: 8px;
      color: white;
      margin-top: 1rem;
      cursor: pointer;
      font-weight: bold;
    }
    button.run-script:hover {
      background: #1ed760;
    }
    .preset-scripts {
      margin-top: 2rem;
    }
    .preset-scripts h3 {
      margin-bottom: 0.5rem;
    }
    .script-box {
      background: #2d2d3d;
      padding: 0.75rem;
      border-radius: 0.75rem;
      margin-bottom: 1rem;
      cursor: pointer;
      font-family: monospace;
      font-size: 0.9rem;
      white-space: pre-wrap;
    }
    .script-box:hover {
      background: #3a3a4a;
    }
  </style>

    const searchInput = document.getElementById('searchInput');
    const prizeGrid = document.getElementById('prizeGrid');
    const prizeCount = document.getElementById('prizeCount');

    function renderPrizes(filter = "") {
      prizeGrid.innerHTML = "";
      const filtered = prizes.filter(p => p.toLowerCase().includes(filter.toLowerCase()));
      prizeCount.textContent = `${filtered.length} prize${filtered.length !== 1 ? 's' : ''} shown`;

      filtered.forEach(prize => {
        const card = document.createElement('div');
        card.className = 'card';
        card.textContent = prize;
        prizeGrid.appendChild(card);
      });
    }

    searchInput.addEventListener('input', (e) => {
      renderPrizes(e.target.value);
    });

        language: 'javascript',
        theme: 'vs-dark',
        automaticLayout: true
      });
    });

    // Run Script
    function runScript() {
      try {
        const userCode = window.editor.getValue();
        new Function(userCode)();
      } catch (err) {
        alert("Script Error: " + err.message);
      }
    }

    // Copy preset script into editor
    function copyToEditor(scriptText) {
      if (window.editor) {
        window.editor.setValue(scriptText);
        window.editor.focus();
      }
